import React, { Component } from "react";
import "../styles/stylesheet.css";
import "../styles/Article.css";
import Navbar from "./Navbar.js";
import Footer from "./Footer.js";

export default class Article extends Component {
  constructor(props) {
    super(props);

    this.state = {
      news: [],
      isLoaded: false,
      errorMsg: null
    };
  }

  componentDidMount() {
    axios
      .get("http://localhost:8000/sak")
      .then(response => {
        console.log(response);
        this.setState({ news: response.data });
        this.setState({ isLoaded: true });
      })
      .catch(error => {
        console.log(error);
        this.setState({ errorMsg: "Error retreiving data" });
      });
  }
  render() {
    return (
      <div className="home-container bg-light">
        <Navbar />
        <img id="image" src="../resources/trump1920x1080.jpg" />
        <div className="text-box">
          <h1>Trump gifter seg for 19. gang</h1>
          <h3>Denne gangen med 16 år gamle Greta Thunberg</h3>
          <br />
          <p id="info-text">Av KASPER VEDAL GUNDERSEN | 22.10.2019 | 15:53</p>
          <br />
          <p className="mx-auto">
            NEW YORK (IrishMedia): Det kontroversielle bildet ble delt på
            Twitter i helgen, og viser Donald Trump som blir drept av hælen til
            Nancy Pelosi,
          </p>
        </div>

        <Footer />
      </div>
    );
  }
}
